    "["POD charts are produced under the authority of the National Ocean Service,
    National Oceanic and Atmospheric Administration (NOAA). NOAA is the national hydrographic
    office for the United States of America (33USC para 883a et seq.).  The data from
    which this POD chart was produced is certified by NOAA for navigational use.  POD
    charts meet the requirements for the mandatory carriage of nautical charts established
    by the U.S. Coast Guard and published in Titles 33 and 46, Code of Federal Regulations,
    including the requirements for updating.OceanGrafix, LLC. warrants that the nautical
    charts manufactured by OceanGrafix as authorized by NOAA and NOS, pursuant to that
    certain Cooperative Research and Development Agreement entered into by and among
    OceanGrafix, NOAA, and NOS, are accurate reproductions of the nautical chart data
    files and updates thereto provided to OceanGrafix by NOAA and NOS.  Additionally,
    OceanGrafix warrants that the Charts shall be free from defects in manufacturing
    materials and workmanship for a period of 90 days from the date of shipment of the
